import React from "react";
import ShoppingBasketIcon from '@mui/icons-material/ShoppingBasket';
import "../../index.css";

const HeaderCartButton = (props) => {
  return (
    <div>
    
    <button className="items-center text-lg hover:bg-[#2c0d00] border-none rounded-xl py-1 px-4 bg-[#4d1601] flex justify-around text-white font-bold w-44 h-12">
      <span >
      <ShoppingBasketIcon sx={{height: '1.5rem', mb:'3px'}} />
      </span>
      <span>Your Cart</span>
      <span>3</span>
    </button>
    </div>
  );
};

export default HeaderCartButton;
